/// A widget that displays an icon using efficient JSON structure.
class HugeIcon extends StatelessWidget {
  final List<List<dynamic>> icon;
  final Color color;
  final double size;
  final double? strokeWidth;

  const HugeIcon({
    super.key,
    required this.icon,
    required this.color,
    this.size = 24.0,
    this.strokeWidth,
  });

  String _buildSvgFromJson(List<List<dynamic>> iconData) {
    final buffer = StringBuffer();
    buffer.write('<svg width="24" height="24" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">');
    for (final element in iconData) {
      final tagName = element[0] as String;
      final attributes = element[1] as Map<String, dynamic>;
      buffer.write('<$tagName');
      for (final entry in attributes.entries) {
        final key = entry.key;
        final value = entry.value;
        if (key == 'key') {
          continue;
        }
        String finalValue = value.toString();
        if (key == 'stroke' && value == 'currentColor') {
          finalValue = '#${color.toARGB32().toRadixString(16).padLeft(8, '0').substring(2)}';
        } else if (key == 'fill' && value == 'currentColor') {
          finalValue = '#${color.toARGB32().toRadixString(16).padLeft(8, '0').substring(2)}';
        } else if (key == 'strokeWidth' && strokeWidth != null) {
          finalValue = strokeWidth.toString();
        }
        String svgAttrName = key;
        if (key == 'strokeWidth') svgAttrName = 'stroke-width';
        else if (key == 'strokeLinecap') svgAttrName = 'stroke-linecap';
        else if (key == 'strokeLinejoin') svgAttrName = 'stroke-linejoin';
        else if (key == 'fillRule') svgAttrName = 'fill-rule';
        else if (key == 'clipRule') svgAttrName = 'clip-rule';
        buffer.write(' ' + svgAttrName + '="' + finalValue + '"');
      }
      buffer.write('/>');
    }
    buffer.write('</svg>');
    return buffer.toString();
  }

  @override
  Widget build(BuildContext context) {
    final svgString = _buildSvgFromJson(icon);
    return SvgPicture.string(
      svgString,
      width: size,
      height: size,
    );
  }
}
